<template>
  <div class="content">
    <div class="main" id="shareImg">
      <!-- base64图片 -->
      <img
        class="title"
        src="data:image/png;base64,"
      />
      <RouterView :createPoster="createPoster" />
    </div>
  </div>
  <van-popup round id="vanopup" v-model:show="show">
    <img class="popupImg" :src="posterImg" />
  </van-popup>
  <div class="down" v-show="show">长按保存图片<van-icon name="share-o" /></div>
</template>
<script setup lang="ts">
import { RouterView } from "vue-router";
import { ref } from "vue";
import html2canvas from "html2canvas";
const posterImg = ref();
const show = ref(false);
//生成图片
const createPoster = (id: string) => {
  const shares = document.getElementById(id);
  html2canvas(shares!, {
    useCORS: true,
    allowTaint: true,
    ignoreElements: (element: Element) => {
      const isButtons = element.classList.contains("button-group");
      return isButtons;
    },
  }).then((cavans) => {
    posterImg.value = cavans.toDataURL("image/png");
    show.value = true;
  });
};
</script>
